import { Injectable } from '@angular/core';
import { Footballer } from '../models/footballers';

@Injectable({
  providedIn: 'root'
})
export class FootballersService {

  url = "Footballer";

  constructor() { }

  public getFootballers(): Footballer[] {
    let footballer = new Footballer();
    footballer.id = 1;
    footballer.firstName = "Lionel";
    footballer.lastName = "Messi";
    footballer.goals = 900;
    footballer.team = "Inter Miami FC";

    return [footballer];
  }
}
